import React from 'react';
import '../App.css';

function VideoStatBox({ title, views, error }) {
  return (
    <div className="channel-col">
      <h2>{title}</h2>
      {views !== null && views !== undefined ? (
        <div className="stat">Views: <span>{views}</span></div>
      ) : error ? (
        <div className="stat error">{error}</div>
      ) : (
        <div className="stat">Loading views...</div>
      )}
    </div>
  );
}

export default VideoStatBox;
